class Stack(object):
	def __init__(self):
		self._list = []

	def pop(self):
		return self._list.pop(0)

	def push(self, el):
		self._list.insert(0, el)

	def is_empty(self):
		return len(self._list) < 1

	def __repr__(self):
		return " ".join([str(x) for x in self._list])

	def __str__(self):
		return self.__repr__()

class MyQueue(object):
	def __init__(self):
		self.s1 = Stack()
		self.s2 = Stack()

	def append(self, el):
		if self.s1.is_empty():
			self.__shift_stacks(self.s2, self.s1)
		self.s1.push(el)

	def pop(self):
		if self.s2.is_empty():
			self.__shift_stacks(self.s1, self.s2)
		return self.s2.pop()

	def is_empty(self):
		return self.s1.is_empty() and self.s2_is_empty()

	def __shift_stacks(self, source, target):
		while not source.is_empty():
			target.push(source.pop())

	def __str__(self):
		return str(self.s1) + str(self.s2) + "\n"

